import React, { useState } from "react";

function Experience() {
    const [position, setPosition] = useState("");
    const [company, setCompany] = useState("");
    const [from, setFrom] = useState("");
    const [to, setTo] = useState("");
    const prevExperience = [position, company, from, to];

    return (
        <div>
            <input type="text" placeholder="Position" value={position}/>
            <input type="text" placeholder="Company" value={company}/>
            <input type="text" placeholder="From" value={from}/>
            <input type="text" placeholder="To" value={to}/>
        </div>
    )
}

export default Experience;
